// Validate input data from email or form submission
const item = $input.item.json;

// Initialize validation result
let isValid = true;
let errors = [];

// Check for required fields
if (!item.email && !item.text && !item.body && !item.content) {
  isValid = false;
  errors.push('Missing required field: email or text content');
}

// Validate email format if present
if (item.email) {
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!emailRegex.test(item.email)) {
    isValid = false;
    errors.push('Invalid email format');
  }
}

// Check for text content
const textContent = item.text || item.body || item.content || '';
if (textContent.trim().length === 0) {
  isValid = false;
  errors.push('Missing text content');
}

// Return validation result
return {
  ...item,
  validation: {
    isValid: isValid,
    errors: errors,
    timestamp: new Date().toISOString()
  }
};

// Parse AI Response and extract structured lead data
// Note: Parses AI response into structured fields for downstream processing
const aiResponse = $input.item.json;

// If the AI response is a string, parse it as JSON
let leadData;
if (typeof aiResponse === 'string') {
  try {
    leadData = JSON.parse(aiResponse);
  } catch (error) {
    // If parsing fails, try to extract JSON from the string
    const jsonMatch = aiResponse.match(/\{[\s\S]*\}/);
    if (jsonMatch) {
      leadData = JSON.parse(jsonMatch[0]);
    } else {
      throw new Error('Unable to parse AI response as JSON');
    }
  }
} else {
  leadData = aiResponse;
}

// Extract and structure the lead data fields
const structuredLead = {
  firstName: leadData.firstName || leadData.first_name || '',
  lastName: leadData.lastName || leadData.last_name || '',
  email: leadData.email || '',
  phone: leadData.phone || leadData.phoneNumber || '',
  company: leadData.company || leadData.companyName || '',
  jobTitle: leadData.jobTitle || leadData.title || '',
  industry: leadData.industry || '',
  companySize: leadData.companySize || leadData.company_size || '',
  country: leadData.country || leadData.location || '',
  state: leadData.state || leadData.region || '',
  city: leadData.city || '',
  budget: leadData.budget || '',
  timeline: leadData.timeline || leadData.purchaseTimeline || '',
  painPoints: leadData.painPoints || leadData.pain_points || [],
  interests: leadData.interests || leadData.products_interested || [],
  source: leadData.source || 'unknown',
  notes: leadData.notes || leadData.additionalInfo || '',
  rawResponse: aiResponse
};

return structuredLead;

// Calculate lead score using transparent rubric (0-100 points)
// Scores leads 0-100 based on ICP criteria from Workflow Configuration: Industry Match (30pts), Company Size (25pts), Role Match (25pts), Problem Statement (10pts), Budget Signals (10pts). Categorizes as Hot (80+), Warm (60-79), Cold (40-59), or Unqualified (<40).
const item = $input.item.json;

// Initialize scoring
let score = 0;
let breakdown = {};
let reasoning = [];

// Target industries for scoring - read from Workflow Configuration
const targetIndustries = ($('Workflow Configuration').first().json.targetIndustries || '').toLowerCase().split(',').map(i => i.trim());

// Buyer roles that indicate decision-making authority - read from Workflow Configuration
const buyerRoles = ($('Workflow Configuration').first().json.buyerRoles || '').toLowerCase().split(',').map(r => r.trim());

// Budget signal keywords
const budgetSignals = ['budget', 'investment', 'funding', 'purchase', 'buy', 'pricing', 'cost', 'quote', 'proposal'];

// 1. Industry Match (30 points)
const industry = (item.industry || '').toLowerCase();
const industryMatch = targetIndustries.some(target => industry.includes(target));
if (industryMatch) {
  score += 30;
  breakdown.industry = 30;
  reasoning.push(`Industry \"${item.industry}\" matches target industries (+30 points)`);
} else {
  breakdown.industry = 0;
  reasoning.push(`Industry \"${item.industry}\" does not match target industries (0 points)`);
}

// 2. Company Size (25 points)
const companySize = parseInt(item.companySize || item.company_size || 0);
if (companySize >= 100) {
  score += 25;
  breakdown.companySize = 25;
  reasoning.push(`Company size ${companySize} meets minimum threshold (+25 points)`);
} else if (companySize >= 50) {
  score += 15;
  breakdown.companySize = 15;
  reasoning.push(`Company size ${companySize} is moderate (+15 points)`);
} else if (companySize >= 10) {
  score += 5;
  breakdown.companySize = 5;
  reasoning.push(`Company size ${companySize} is small (+5 points)`);
} else {
  breakdown.companySize = 0;
  reasoning.push(`Company size ${companySize} is below threshold (0 points)`);
}

// 3. Role Match (25 points)
const role = (item.role || item.jobTitle || item.title || '').toLowerCase();
const roleMatch = buyerRoles.some(buyerRole => role.includes(buyerRole));
if (roleMatch) {
  score += 25;
  breakdown.role = 25;
  reasoning.push(`Role \"${item.role || item.jobTitle || item.title}\" indicates decision-making authority (+25 points)`);
} else {
  breakdown.role = 0;
  reasoning.push(`Role \"${item.role || item.jobTitle || item.title}\" does not indicate decision-making authority (0 points)`);
}

// 4. Clear Problem Statement (10 points)
const message = (item.message || item.description || item.problem || '').toLowerCase();
const hasProblemStatement = message.length > 50 && (message.includes('need') || message.includes('problem') || message.includes('challenge') || message.includes('looking for') || message.includes('help'));
if (hasProblemStatement) {
  score += 10;
  breakdown.problemStatement = 10;
  reasoning.push('Clear problem statement provided (+10 points)');
} else {
  breakdown.problemStatement = 0;
  reasoning.push('No clear problem statement (0 points)');
}

// 5. Budget Signals (10 points)
const hasBudgetSignals = budgetSignals.some(signal => message.includes(signal));
if (hasBudgetSignals) {
  score += 10;
  breakdown.budgetSignals = 10;
  reasoning.push('Budget signals detected in message (+10 points)');
} else {
  breakdown.budgetSignals = 0;
  reasoning.push('No budget signals detected (0 points)');
}

// Determine lead quality tier
let tier = '';
if (score >= 80) {
  tier = 'Hot Lead';
} else if (score >= 60) {
  tier = 'Warm Lead';
} else if (score >= 40) {
  tier = 'Cold Lead';
} else {
  tier = 'Unqualified';
}

// Return enriched data with scoring
return {
  ...item,
  leadScore: score,
  leadTier: tier,
  scoreBreakdown: breakdown,
  scoreReasoning: reasoning,
  scoredAt: new Date().toISOString()
};

